import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Rating from '@material-ui/lab/Rating';
import PanoramaFishEyeTwoToneIcon from '@material-ui/icons/PanoramaFishEyeTwoTone';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

const StyledRating = withStyles({

    icon: {
        color: 'grey',
    },
    iconFilled: {
        color: '#B6C512',
        
    },
    root: {
        margin: '0px',
    }
})(Rating);

const StyledBox = withStyles({
    root: {
        margin: '0px 0px 0px 10px',
        padding: '0px',
        width: '100%',
        display: 'flex',
        flexDirection : "row",
        flexWrap: "nowrap",
        alignContent: 'center',
    }
})(Box);





export default function ScrRatingChart() {
    const [ScrMarche, setScrMarche] = React.useState(100);
    const [ScrAction, setScrAction] = React.useState(100);
    const [ScrTaux, setScrTaux] = React.useState(100);
    const [ScrDevise, setScrDevise] = React.useState(100);
    const [ScrContrepartie, setScrContrepartie] = React.useState(100);
    
    return (
        <div>

            <StyledBox component="fieldset" mb={0} borderColor="transparent">
            <Typography display="inline" component="legend" color="white" variant="subtitle1" >SCR Marché: {ScrMarche}%</Typography>
                <StyledRating
                    name="customized-color"
                    value={ScrMarche/10}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
                 
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle1" >SCR Action: {ScrAction}%</Typography>
                <StyledRating
                    name="customized-color"
                    value={ScrAction/10}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle1" >SCR Taux:  {ScrTaux}%</Typography>
                <StyledRating
                    name="customized-color"
                    value={ScrTaux/10}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle1" >SCR Devise: {ScrDevise}%</Typography>
                <StyledRating
                    name="customized-color"
                    value={ScrDevise/100}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle1" >SCR Contrepartie: {ScrContrepartie}%</Typography>
                <StyledRating
                    name="customized-color"
                    value={ScrContrepartie/10}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>


        </div>
    );
}
